import Container from '../layout/Container'

export default function Home(){

    const candidatos = ['japao','japones','viado','gay']

    return(
        <Container>
            <div className="container">
            <div className="row">
                <div className="col-md-12 text-center">
                 {candidatos.map}       
                </div>
            </div>
            </div>
        </Container>
    )
}
